import React from 'react';
import styled from 'styled-components/macro';

import NaviShoppingcartButton from './NaviShoppingCartButton';
import NaviCategoryBlocksButton from './NaviCategoryBlocksButton';
import NaviProfileButton from './NaviProfileButton';
import NaviFooter from './Footer';


export default function NavigationButtonArea ({changeAppMode}) {

    return (
            <NavBar>
                <NaviShoppingcartButton changeAppMode={changeAppMode}>shopping cart</NaviShoppingcartButton>
                <NaviCategoryBlocksButton changeAppMode={changeAppMode}>categories</NaviCategoryBlocksButton>
                <NaviProfileButton changeAppMode={changeAppMode}>profile</NaviProfileButton>
            </NavBar>
    )
}


const NavBar = styled.div`
    display: flex;
    position: fixed;
    bottom: 0;
    left: 0;
    righT: 0;
    align-items: center;
    height: 80px;
    font-family: Monaco, sans-serif;
    margin-top: 30px;
    position: fix;
    bottom: 0;
    background-image: linear-gradient(135deg, #291080, #030981);
    justify-content: space-around;
    z-index: 11;
`
